import React from "react";
import HomeImg from '../Images/Home1.svg'
import { NavLink } from 'react-router-dom'
import Common from "./Common";

const Home = () => {

  return (
    <>
      <Common
        heading="Want To Gror You Bussiness With"
        highlight="Rectify"
        img={HomeImg}
      />
    </>
  )
}

export default Home;
